import React from 'react';


function Form() {
    return (
      <div className="form-component">
        <form>
            <div>
                <label for="meme-owner">Meme Owner</label>
                <input type="text" name="meme-owner"/>
            </div>
            <div>
                <label for="meme-caption">Caption</label>
                <input type="text" name="meme-caption"/>
            </div>
            <div>
                <label for="meme-image">Meme URL</label>
                <input type="text" name="meme-image"/>
            </div>
            <input type="submit" value="Post"/>
        </form>
      </div>
    );
  }


export default Form;
